import React from 'react';

import Facebook from '../../resources/images/icons/path4808.png';
import Instagram from '../../resources/images/icons/path4797.png';

const Contactanos = () => {
    return (
        <div className="contactanos_wrapper">
            <div className="iconos">
                <list>
                    <a className="contenedor_link" href="https://www.facebook.com/Ment-409357773178947" target="_blank">
                    <img src={Facebook} alt="foto" width='40px'/>
                    </a>

                    <a className="contenedor_link" href="https://www.instagram.com/ment.soluciones" target="_blank">
                    <img src={Instagram} alt="foto" width='40px'/>
                    </a>
                </list>
            </div>
        </div>
    );
};

export default Contactanos;
